webpackJsonp([0xd05fb1124386],{5305:function(e,t){e.exports={data:{post:{html:'<p>Very nice weather this weekend, the whole past week, in fact. Nearly 30&deg;C, sunny, slight breeze. Unusual for northern Germany. We should really be outside.</p>\n<p>While looking for something else at <a href="http://freshmeat.net">FreshMeat</a>, I bumped into <a href="http://billstclair.com/blogmax">BlogMax</a>, "an Emacs package that aids in the creation of a weblog". It creates a Manila-like static site, and is by Bill St. Clair of <a href="http://billstclair.com/blog">End the War on Freedom</a>. It looks interesting, but doesn\'t seem to work with XEmacs.</p>\n<p>Flipping the page with <a href="http://www.konqueror.org">Konqueror</a> (2.2beta1) now works!</p>',fields:{title:"Early to bed?",date:"29 Jul 2001",url:"https://papascott.de/2001-07-29-early-to-bed/"}}},pathContext:{slug:"/2001-07-29-early-to-bed/",prev:{fields:{title:"Bundesdance",date:"26 Jul 2001",slug:"/2001-07-26-bundesdance/"}},next:{fields:{title:"Mama State",date:"30 Jul 2001",slug:"/2001-07-30-mama-state/"}}}}}});
